Desc:
You know the saying &quot; A dog is a man's best friend&quot;, right? Well, that has never been so true until today! Here at House of Taboo we bring you a new species of dog you will want to bring home straight away! Welcome Danielle Maye! She even comes with her own personal trainer, Krystal Webb, who looks like she came from the playboy mansion! Life just got BETTER! Oh and don't worry ladies, Danielle can also be a woman's best friend, she swings both ways as her trainer displays for us! Danielle comes with gorgeous blonde hair and blue eyes with a beautiful set of knockers you'll want to suck on endlessly, but don't let your neighbors catch you, she is a dog...
